import React, { Component } from 'react'
import Card from '../../Components/Card/Card'
import './AllCardsPage.css'

class AllCardsPage extends Component {
    constructor(props) {
        super(props)
        this.state = {
            picsData: []
        }
    }

    componentDidMount() {
        fetch("https://raw.githubusercontent.com/Lokenath/MyRepo/master/Test/package.json")
            .then(response => response.json())
            .then(data => this.setState({ picsData: data.pics }));
    }

    any = (id) => {
        console.log("any clicked", id),
        console.log(this.state.picsData)
    }


    render() {
        return (
            <div className="Cards">
                {this.state.picsData.map(item => <Card any = {this.any} {...item}/>)}
            </div>
        )
    }
}

export default AllCardsPage;
